import React, {Component} from 'react';
import "./index.css"

export default class Header extends Component {
    reload =()=>{
        window.location.reload()
    }
    render() {
        return (
            <div className={"HeaderStyle"}>
                <h2 onClick={this.reload} >hooks</h2>
                <div className={'MoviesPage'}>观影单</div>
            </div>
        )
    }
}
